import {
  Box,
  Field,
  Input,
  Label,
  Control,
  Button,
  Title,
  Buttons,
} from "react-bulma-companion";
import InputMovies from "./InputMovies";
const AddMovie = () => {
  return (
    <Box
      style={{
        maxWidth: "25rem",
        marginTop: "2rem",
        marginLeft: "auto",
        marginRight: "auto",
      }}
    >
      <Title>Add Movie</Title>
      <InputMovies />
      <Buttons className="is-flex is-justify-content-center">
        <Button>Save</Button>
        <Button>Cancel</Button>
      </Buttons>
    </Box>
  );
};

export default AddMovie;
